import React from 'react'
import './RecordLayout.css'
const Recordlayout = ({dataid,userid,name,data}) => {
    const handleClick = (e)=>{
        e.preventDefault()
        alert("Hello world")
    }
    return (
        <div className="item" onClick = {handleClick}>
            <div>{name} asdfdsf</div>
        </div>
    )
}

export default Recordlayout
